import styled from 'styled-components';

export const ListWrapper = styled.div`
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  text-align: left;
  max-width: 75rem;
  width: 100%;
  margin: 0 auto; 
  padding-top: 90px;
`
export const SpinnerWrapper = styled.div`
  justify-content: center;
  padding-top: 50px;
  display: flex;
  flex: 1;
  justify-content: center;
`
